    coinData=getCoinMarketDataApi.request(top10[i]);
  }*/

  return (
    <ScreenArea>
      <View
        style={{
          backgroundColor: colors.primary,
          width: "100%",
          justifyContent: "center",
          alignItems: "center",
          height: 70,
        }}
      >
        <Image
          style={styles.image}
          source={require("./app/assets/images/coincoinlogo.png")}
        />
      </View>

      <NavigationContainer>
        <LoginScreenNavigator />
      </NavigationContainer>
